import * as React from 'react';
import Popover from '@mui/material/Popover';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

export default function PopupSignIn() {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const open = Boolean(anchorEl);
  const id = open ? 'simple-popover' : undefined;

  return (
      <React.Fragment>
        {/*<Button aria-describedby={id} variant="contained" onClick={handleClick}>*/}
        {/*  Open Popover*/}
        {/*</Button>*/}
        <button  href="#whitelist" className="header__btn" data-clone="mint-btn">
                <span onClick={handleClick} className="header__btn-wrapper">

                    <span  className="header__btn-text" style={{overflow:"hidden"}}>asdads</span>
                  <img src="assets/images/glass.png" alt="glass" className="header__btn-glass"/>
                </span>
        </button>
        <Popover
            id={id}
            open={open}
            anchorEl={anchorEl}
            onClose={handleClose}
            anchorOrigin={{
              vertical: 'bottom',
              horizontal: 'left',
            }}
        >
          <Typography sx={{ p: 2 }}>The content of the Popover.</Typography>
        </Popover>
      </React.Fragment>
  );
}
